import React from 'react';
import {connect} from 'react-redux';
import jsPDF from 'jspdf';
const PageSix = ({img,values:{length,width,noOfDrippers,l,d,lengthOfLateral,noOfLateralOnSubMain,dischargeRateQL}}) =>{



function pdfGeneratorAnySide(){
       
  var doc = new jsPDF('p','pt');
  doc.setFontSize(24);
  doc.setTextColor(46,93,249);
  doc.text(240,40,'Result');
  doc.setFontSize(16);
  doc.setTextColor(73,76,87);
  doc.text(20,70, `Length = ${length} m`);
  
  doc.text(20,100, `Width = ${width} m` );
  
  doc.text(20,130, `Number Of Dripper = ${noOfDrippers}`);
  doc.text(20,160, `Submain Place = `);
  doc.setTextColor(255,0,0);
  doc.text(135,160, `  One side of Field`);
  doc.setTextColor(73,76,87);
  doc.text(275,70, `No of Lateral = ${noOfLateralOnSubMain}`);
  
  doc.text(275,130, `Length of One Lateral = ${l} m (${dischargeRateQL.toFixed(3)} lit/sec)`);
  
  doc.text(275,100, `Length of Lateral = ${Math.round(lengthOfLateral)} m`);
  
  doc.text(275,160, `Length of Submain = ${d} m (${(noOfLateralOnSubMain*dischargeRateQL).toFixed(3)} lit/sec)`);
  var img = new Image()
  img.src = 'de.png';

  doc.addImage("data:image/jpeg;base64,", 'png', 100, 230,400, 500)
  doc.save("Drip-Irrigation-Result.pdf");

}
function pdfGeneratorHalfside(){
  var doc = new jsPDF('p','pt');
  doc.setFontSize(24);
  doc.setTextColor(46,93,249);
  doc.text(240,40,'Result');
  doc.setFontSize(16);
  doc.setTextColor(73,76,87);
  doc.text(20,70, `Length = ${length} m`);
  
  doc.text(20,100, `Width = ${width} m` );
  
  doc.text(20,130, `Number Of Dripper = ${noOfDrippers}`);
  
  doc.text(20,160, `Submain Place = `);
  doc.setTextColor(255,0,0);
  doc.text(135,160, `  Half of Side`);
  doc.setTextColor(73,76,87);
  doc.text(275,70, `No of Lateral = ${noOfLateralOnSubMain}`);
  
  doc.text(275,130, `Length of One Lateral = ${l} m (${dischargeRateQL.toFixed(3)} lit/sec)`);
  
  doc.text(275,100, `Length of Lateral = ${Math.round(lengthOfLateral)} m`);
  
  doc.text(275,160, `Length of Submain = ${d} m (${(noOfLateralOnSubMain*dischargeRateQL).toFixed(3)} lit/sec)`);
  var img = new Image()
  img.src = 'de.png';

  doc.addImage("data:image/jpeg;base64,", 'png', 100, 230,400, 500)
 
  doc.save("Drip-Irrigation-Result.pdf");
   
}

  return(
    <>
        <h1 className="text-center text-info my-4">Result</h1>
        {
            img==="anyside"&&<div className="card">
                {}
                    <div className="card-footer d-flex justify-content-center">
                    <button className="btn btn-primary btn-md" onClick={()=>pdfGeneratorAnySide()}> Download Pdf</button>
 
                    </div>  
                  </div>
        }
        {
             img==="half"&&<div className="card">

             
             <div className="card-footer d-flex justify-content-center">
                    <button className="btn btn-primary btn-md" onClick={()=>pdfGeneratorHalfside()}> Download Pdf</button>
 
                    </div> 
           </div>
        }
         <h2 className="text-center my-4 text-light">The End</h2>
    </>
  )

}
const mapStateToProps = state =>{
    return{
        values:state.values
    }
}
export default connect(mapStateToProps,{})(PageSix);
